import React from "react";
import { Card } from "../../Card.styled";
import { CardInline } from "../../Card.styled2";
import { ImageCard } from "../../ImageCard.styled";
const NavBar = ({ content }) => {
  return (
    <>
      <Card
        dp={"grid"}
        gridC={"45% 35% 20%"}
        bd={"1px solid black"}
        height={"1.5rem"}
        mg={"2rem"}
      >
        <Card dp={"grid"} gridC={"auto auto auto auto"} bd={"1px solid red"}>
          <Card bd={"1px solid black"}>{content.NavBarContents[0]}</Card>
          <Card
            pd={"0.25rem 0rem"}
            ta={"center"}
            fs={"0.5rem"}
            bd={"1px solid black"}
          >
            {content.NavBarContents[1]}
          </Card>
          <Card
            pd={"0.25rem 0rem"}
            ta={"center"}
            fs={"0.5rem"}
            bd={"1px solid black"}
          >
            {content.NavBarContents[2]} {content.NavBarContents[3]}
          </Card>
          <Card
            pd={"0.25rem 0rem"}
            ta={"center"}
            fs={"0.5rem"}
            bd={"1px solid black"}
          >
            {content.NavBarContents[4]}
          </Card>
        </Card>
        <Card bd={"1px solid red"}></Card>
        <Card dp={"grid"} gridC={"15% 70% 15%"} bd={"1px solid red"}>
          <Card bd={"1px solid red"}>
            <ImageCard
              mg={"auto"}
              height={"0.6rem"}
              width={"0.6rem"}
              src={content.NavBarContents[5]}
            />
          </Card>
          <Card bd={"1px solid red"}></Card>
          <Card bd={"1px solid red"}>
            <ImageCard
              bg={"green"}
              mg={"0.4rem 0.2rem"}
              pd={"0.4rem 0.2rem"}
              height={"0.8rem"}
              width={"0.8rem"}
              src={content.NavBarContents[7]}
            />
          </Card>
        </Card>
      </Card>
    </>
  );
};

export default NavBar;
